<template>
    <span>
        <img src="data:image/jpeg;base64,"
             class="rocket-display-img-thumb"
             v-if="files.length===0"
             />
         <v-dialog v-else v-model="showPreview" lazy absolute>
             <img slot="activator" :src="thumbnail" class="rocket-display-img-thumb card--hover" />
              <v-carousel>
                <v-carousel-item v-for="file in files" v-bind:src="file.url" :key="file.fileid"></v-carousel-item>
              </v-carousel>
         </v-dialog>

    </span>

</template>
<style>
    .rocket-display-img-thumb{
        max-width:64px;
        max-height:64px;
    }
</style>
<script>
    export default{
        props : {
            files : {type:Array, required:true},
        },
        data(){
            return {
                showPreview : false
            }
        },
        computed:{
            thumbnail(){
                return this.files[0].thumbnail;
            }
        }
    }
</script>
